import React, { Component } from 'react';

export class ListItems extends Component {
    continue = e => {
        e.preventDefault();
        this.props.nextStep();
    };
    render(){
        return (
          <div className="App">
            <h3><center>Simple TODO List Web App :)</center></h3>

          </div>
        );
       }
    }
    export default ListItems;
